import React, { useState } from 'react';
import axios from 'axios';
import './ResumeUpload.css'; 

function ResumeUpload() {
  const [resume, setResume] = useState(null);
  const [resumeData, setResumeData] = useState(null);
  const [uploadStatus, setUploadStatus] = useState('');

  // Handle file selection
  const handleFileChange = (e) => {
    if (e.target.files.length > 0) {
      setResume(e.target.files[0]);
      setResumeData(null);
      setUploadStatus('');
    }
  };

  // Handle drag & drop
  const handleDragOver = (e) => e.preventDefault();
  const handleDrop = (e) => {
    e.preventDefault();
    if (e.dataTransfer.files.length > 0) {
      setResume(e.dataTransfer.files[0]);
      setResumeData(null);
      setUploadStatus('');
    }
  };

  // Upload file
  const handleUpload = async (e) => {
    e.preventDefault();
    if (!resume) {
      setUploadStatus('Please select a file first');
      return;
    }

    const formData = new FormData();
    formData.append('file', resume);

    try {
      const response = await axios.post('http://localhost:8080/resume/upload', formData, {
        // Do NOT set Content-Type; Axios will handle it
      });

      setResumeData(response.data);
      setUploadStatus('Resume uploaded successfully!');
    } catch (error) {
      console.error('Error uploading file:', error);
      setUploadStatus('Failed to upload resume');
    }
  };

  // Helper function to render sections
  const renderSection = (title, data) => {
    if (!data || data.length === 0) return null;
    return (
      <div className="resume-section">
        <h3>{title}</h3>
        <ul>
          {data.map((item, idx) => (
            <li key={idx}>{item}</li>
          ))}
        </ul>
      </div>
    );
  };

  return (
    <div className="upload-container">
      <h2>Upload Your Resume</h2>
      <form onSubmit={handleUpload} className="upload-form">
        <div 
          className="drop-zone" 
          onDragOver={handleDragOver} 
          onDrop={handleDrop}
          onClick={() => document.getElementById('file-input').click()}
        >
          <input 
            type="file" 
            id="file-input" 
            accept=".pdf,.doc,.docx" 
            onChange={handleFileChange} 
            style={{ display: 'none' }}
          />
          {resume ? (
            <p>{resume.name}</p>
          ) : (
            <p>Drag & drop your resume here, or click to select a file</p>
          )}
        </div>
        <button type="submit">Upload</button>
      </form>

      {uploadStatus && <p className="upload-status">{uploadStatus}</p>}

      {resumeData && (
        <div className="resume-data">
          <h3>Basic Info</h3>
          <p><strong>Name:</strong> {resumeData.name}</p>
          <p><strong>Email:</strong> {resumeData.email}</p>
          <p><strong>Phone:</strong> {resumeData.phone}</p>
          <p><strong>LinkedIn:</strong> {resumeData.linkedIn}</p>
          <p><strong>GitHub:</strong> {resumeData.github}</p>

          {renderSection('Education', resumeData.education)}
          {renderSection('Projects', resumeData.projects)}
          {renderSection('Experience', resumeData.experience)}
          {renderSection('Skills', resumeData.skills)}
          {renderSection('Certifications', resumeData.certifications)}
          {renderSection('Technologies', resumeData.technologies)}
        </div>
      )}
    </div>
  );
}

export default ResumeUpload;
